import React from 'react';
import Nav from './Nav';
import './css/recipe.css'

import food1 from '../images/f-image-1.png';
import food2 from '../images/f-image-2.png';
import food3 from '../images/f-image-3.png';
import food4 from '../images/f-image-.png';
import food5 from '../images/f-image-4.png';
import food6 from '../images/f-image-3.png';
import food7 from '../images/f-image-2.png';
import food8 from '../images/f-image-1.png';



function Food() {
  return (
    <div className='food' >
      <div className='sec-6'><Nav/>
        <div className='sec-7'></div>
        <div className='sec-8'>
          <div className='f-box-2'></div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food1} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food2} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food3} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food4} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food5} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food6} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food7} alt='food-1'/>
          </div>
          <div className='f-box-1'>
            <img className='f-image-1' src={food8} alt='food-1'/>
          </div>
        </div>
      </div>
        
        
    </div>
  );
}

export default Food;
